INSERT INTO cityamenities VALUES (1,5,12,20,'Armorer','Creator of fine armor not available at a blacksmith.');
INSERT INTO cityamenities VALUES (2,10,20,30,'Butcher','Procurer of meats.');
INSERT INTO cityamenities VALUES (3,10,20,30,'Bakery','Breads, noodles, and other baked goods.');
INSERT INTO cityamenities VALUES (4,10,20,30,'Blacksmith','Maker of tools, solid metal weapons, and armor.');
INSERT INTO cityamenities VALUES (5,0,15,25,'Construction Detail','Need something built out of stone or wood? These guys can handle any of your large jobs.');
INSERT INTO cityamenities VALUES (6,5,15,25,'Carpenter','Craftsmen of fine furniture, and other wooden goods.');
INSERT INTO cityamenities VALUES (7,5,13,25,'Boat Maker','Manufacturers of ships and boats. We are expensive, but we will get you there.');
INSERT INTO cityamenities VALUES (8,6,14,27,'Sail Car Maker','Wind is cheaper than gasoline.');
INSERT INTO cityamenities VALUES (9,1,5,40,'Trade Depot','If you can\'t find it, that\'s cuz you haven\'t asked us. Dealer in arms, armor, and military supplies.');
INSERT INTO cityamenities VALUES (10,30,45,70,'Tavern','Whether they scrape the eyeballs off the floor after closing, or they entertain only those of the highest stature, it seems like every town has at least one bar, and usually many.');
INSERT INTO cityamenities VALUES (11,10,25,40,'Tailor','Artists of the cloth, tailors cloth those who have no domestics skill of their own.');
INSERT INTO cityamenities VALUES (12,15,30,50,'Farmers Market','Everyone needs to eat, and fresh foods are cheap compared to non perishables.');
INSERT INTO cityamenities VALUES (13,5,18,45,'Inn','Sometimes called a bed & breakfast, these estblishments provide shelter and food for the weary traveler.');
INSERT INTO cityamenities VALUES (14,1,5,25,'Restaurant','A place to get an inviting fresh cooked meal, unlike the grubs and rations you\'ve been surviving on these past few months.');
INSERT INTO cityamenities VALUES (15,1,5,25,'Weapon Smith','A shop that specializes in the construction and repair of firearms and sometimes explosive devices.');
INSERT INTO cityamenities VALUES (16,2,8,30,'Bank','Though a little different than what you consider a bank today, this is a place you can pay to store some of your stuff in a guarded lock box and keep it relatively safe.');
INSERT INTO cityamenities VALUES (17,1,1,20,'Pharmacy','A store that specializes in the creation and sales of chemical and herbal medicine. Sometimes the pharmacist will pull double duty and work with chemicals toward other ends like polymers and explosives.');
INSERT INTO cityamenities VALUES (18,1,5,20,'Medical Doctor','Though medical personel is almost a must, most villages won\'t have a doctor, but if they do, you can go to him/her to get yourself fixed up.');
INSERT INTO cityamenities VALUES (19,1,5,15,'Hospital','Usually you will only find a hospital in cities. If you have a bad illness or severe wounds, a hospital may be the only thing that can save you.');
INSERT INTO cityamenities VALUES (20,9,20,35,'General Outfiter','This shop is reminicent of the old general stores of the 1800\'s. It carries a little of everything, but usually nothing too rare.');
INSERT INTO cityamenities VALUES (21,0,0,20,'Casino','Though most tavern\'s allow gambling, you won\'t find a full fledged casino anywhere except a pretty good sized city.');
INSERT INTO cityamenities VALUES (22,15,28,50,'Theatre','Live performance is a great source of entertainment. All kinds of performers, actors, musicians, and story tellers may be on showcase. Almost all forms of civilization have some public forum like this, even if it is just a dirt circle with logs gathered around it for seating.');
INSERT INTO cityamenities VALUES (23,1,20,40,'Government Building','Chances are, that if you\'re in a town or a city, that is not military controlled, they will have some form of disorganized government.');
INSERT INTO cityamenities VALUES (24,1,10,30,'Military Hub','Common in areas of Military rule, these buildings serve as a staging area for soldiers.');
INSERT INTO cityamenities VALUES (25,5,5,30,'Food Pantry','These merchants specialize in non-perishable food items like canned goods, dried foods, and rations. They will also usually have a good supply of purified water on hand.');
INSERT INTO cityamenities VALUES (26,30,30,30,'Local Guide','Every type of terrain is different. The landmarks change, the hangouts and hideouts are hidden, and you\'ve never been here before. You\'re in luck. That\'s why we\'re here to help you find your way around.');
INSERT INTO cityamenities VALUES (27,18,12,6,'Gadget Guy','Sort of a jack-of-all-trades, a local gadget guy can help you out when there isn\'t a better alternative in a small village or town.');
INSERT INTO cityamenities VALUES (28,5,10,15,'Medical Trainer','Someone to show you the ropes in the field of medicine. It will be expensive, but worth every $tandard.');
INSERT INTO cityamenities VALUES (29,5,10,15,'Mechanical Trainer','Someone to show you the ropes in the field of mechanics. It will be expensive, but worth every $tandard.');
INSERT INTO cityamenities VALUES (30,5,10,15,'Hand to Hand Combat Trainer','Someone to show you the ropes in the field of hand to hand combat. It will be expensive, but worth every $tandard.');
INSERT INTO cityamenities VALUES (31,5,10,15,'WeaponSmith Apprenticeship','Someone to show you the ropes in the field of weapons engineering. It will be expensive, and very time consuming, but worth every $tandard.');
INSERT INTO cityamenities VALUES (32,5,10,15,'Blacksmith Aprenticeship','Someone to show you the ropes in the field of metalworking. It will be expensive, and very time consuming, but worth every $tandard.');
INSERT INTO cityamenities VALUES (33,5,10,15,'Armorsmith Aprenticeship','Someone to show you the ropes in the field of armorsmithing. It will be expensive, and very time consuming, but worth every $tandard.');
INSERT INTO cityamenities VALUES (34,4,4,4,'Library','This is an incredible find. Libraries are incredibly rare, and this one has quite an assortment.');
INSERT INTO cityamenities VALUES (35,9,9,9,'Small Library','This is an incredible find. Libraries are incredibly rare. Though this one only has about 70 books, it can still be very useful.');
INSERT INTO cityamenities VALUES (36,6,11,26,'Mechanic','If you\'ve got something mechanical in need of repair, these guys can be a lifesaver.');
INSERT INTO cityamenities VALUES (37,3,9,15,'Electronics FixIt Shop','This store can sell you electronics and electrical gadgets, and even repair them. Sometimes they\'ll even sell you batteries to power the gadget! But be warned, batteries are very expensive.');
INSERT INTO cityamenities VALUES (38,2,5,35,'Massage Parlour','Even in a post war wasteland, stress therapy is a economical megalith.. But who has the equipment for cleaning acupuncture needles?... not the ladies you\'ll meet at these places... After a long trek through the wasteland, you\'ll find no sweeter sight.');
INSERT INTO cityamenities VALUES (39,5,7,11,'Shady Dealer','Everyone in deadEarth will seem shady at times. In fact, there\'s probably no one you can trust. To make it even worse, there are Shady Dealers. These merchants specialize in the sale of items and equipment that aid thieves.');
INSERT INTO cityamenities VALUES (40,9,9,9,'Herbalist','This cross-breed (figurative, not physical) of a pharmacist, astrologer, and spirit healer just may have the cure for what\'s ailing you. Then again, she may simply have a putrid smelling liquid that she wants to sell you.');
INSERT INTO cityamenities VALUES (41,1,1,1,'Geneticist','This person can not only tell you how the radiation has affected your body, but may be able to reverse its effects; maybe.');
INSERT INTO cityamenities VALUES (42,6,17,20,'Cartographer','At this store you will find maps and atlases of all sorts. Prewar atlases may be out of date, but they are generally worth more than new ones because they are typically more accurate.');
INSERT INTO cityamenities VALUES (43,5,10,15,'Weapons Trainer','If you\'ve got the $tandards, then these guys will teach you how to fight with instruments of destruction.');
INSERT INTO cityamenities VALUES (44,3,9,12,'Greenhouse','If you want to start growing something, you\'ll need to start by purchasing some seedlings.');
INSERT INTO cityamenities VALUES (45,2,2,2,'Iron Mine','The ground is rich with iron deposits here.');
INSERT INTO cityamenities VALUES (46,2,2,2,'Gold Mine','The ground here has a fair amount of gold deposits.');
INSERT INTO cityamenities VALUES (47,2,2,2,'Tin Mine','The ground here has a fair amount of tin deposits.');
INSERT INTO cityamenities VALUES (48,5,5,5,'Fresh Water Spring','This city was built around a fresh water spring.');
INSERT INTO cityamenities VALUES (49,5,5,5,'River','A river runs through this area. Perhaps that\'s why civilization sprung up here.');
INSERT INTO cityamenities VALUES (50,5,5,5,'Pond','There is a good sized pond near here. Be careful though, standing water often holds much radiation.');
INSERT INTO cityamenities VALUES (51,0,8,8,'Logging Camp','A logging camp was established presumably to cut down trees and turn them into useful items. Hmmm. Sounds suspicious to me. ');
INSERT INTO cityamenities VALUES (52,7,7,7,'Wind Generator','This area has a limited amount of power supplied by its wind generator.');
INSERT INTO cityamenities VALUES (53,1,1,1,'Abandoned Nuclear Power Plant','This area has a nuclear power plant. It has been shut down for almost 10 years, but with a lot of work, and even more knowledge, it could be restored.');
INSERT INTO cityamenities VALUES (54,7,7,7,'Hydro Generator','This area has a limited amount of power due to the hydro-electric generator built into a nearby dam.');
INSERT INTO cityamenities VALUES (55,3,2,1,'Gas Station','A local has discovered an old gas station which still has a quantity of fuel in its storage tank. The fuel is old but with octane additives (which he also has for sale) it will power a gasoline engine. He is now selling that fuel for 30% over the going rate. If you\'re thinking of stealing from him, you may want to have a look at his guards first.');
INSERT INTO cityamenities VALUES (56,1,1,10,'School','Though schools for children were common in days past, they are not so common in deadEarth. This city is fortunate to have one.');
INSERT INTO cityamenities VALUES (57,3,9,15,'Roughneck Store','The Roughneck Store is the store for the workin\' man. We specialize in tools and equipment for building, digging, and repairing just about everything.');
INSERT INTO cityamenities VALUES (58,1,2,3,'Fruit Cart','A traveling vendor has a cart with fresh fruit (sometimes semi-fresh). This is a rare find and the vitamin C and citric acid from these fruits will help fight off infection and scurvy.');
INSERT INTO cityamenities VALUES (59,2,2,2,'Lead Mine','The ground is rich with lead deposits here.');
INSERT INTO cityamenities VALUES (60,2,2,2,'Salt Mine','The ground is rich with salt deposits here.');
INSERT INTO cityamenities VALUES (61,5,15,30,'Arena','The people here have constructed an arena where they hold tournaments of physical prowess. If you are a gambler, this is also a great place to try your luck.');
INSERT INTO cityamenities VALUES (62,1,2,3,'Pit Fights','Welcome to the most gruesome event in sports entertainment. The people here have constructed a pit fighting arena. The fights in the pits are usually used to settle scores. They are very bloody, and always to the death.');
INSERT INTO cityamenities VALUES (63,2,2,2,'Gallows','You can tell that this area deals with criminals in a swift manner as you pass by the gallows.');
INSERT INTO cityamenities VALUES (64,2,2,2,'Executioner\'s Stage','The Executioner\'s stage has attracted a crowd, as someone is about to be relieved of their head. Crime is obviously dealt with in a serious manner here.');
INSERT INTO cityamenities VALUES (65,1,7,12,'Bath House','If you\'ve been traveling or had a hard day, perhaps you should make a stop at the local bath house for some relaxation.');
INSERT INTO cityamenities VALUES (66,7,19,50,'Rental Room','A local has a room for rent. It\'s not quite as nice as a room at an Inn, and there is no breakfast, but it is only about half the price.');
INSERT INTO cityamenities VALUES (67,0,2,7,'Tournament of Swords','You\'ve discovered a tournament of swords. Some of the best sword fighters within 500 miles are at this tournament. Top prize is D6x1000 $tandards.');
INSERT INTO cityamenities VALUES (68,0,2,7,'Tournament of the Fist','You\'ve discovered a tournament of the fist. Some of the best hand to hand combatants within 500 miles are at this tournament. Top prize is D6x1000 $tandards.');
INSERT INTO cityamenities VALUES (69,0,2,7,'Tournament of Firearms','You\'ve discovered a tournament of firearms. Some of the best shooters within 500 miles are at this tournament. Top prize is D6x1000 $tandards.');
INSERT INTO cityamenities VALUES (70,2,2,2,'Bloodwing Cages','Criminals are obviously not tollerated in this area. The stench of the decaying flesh in the bloodwing cages is proof of that. (Note: Bloodwing cages are elevated above city streets, and criminal\'s entrails are pulled out through their back and left in the sun to dry while the criminal is still alive.)');
INSERT INTO cityamenities VALUES (71,1,20,80,'Guard House','From this distance you cannot tell if they are military or local police, but as you aproach the city, you see guard houses.');
INSERT INTO cityamenities VALUES (72,1,10,10,'Festival','The locals are having a festival. It looks like a good source of entertainment and food to a weary traveler such as yourself.');
INSERT INTO cityamenities VALUES (73,10,10,10,'Abandoned Houses','There are some abandoned houses nearby, due to the local population there probably won\'t be any good salvage, but it might be a good place to sleep for the night.');
INSERT INTO cityamenities VALUES (74,1,2,2,'Slave Trade','There\'s a serious slave trade here. Be careful not to get sold yourself. Foreigners (people not local to this area) often become the slaves in a slave trade.');
INSERT INTO cityamenities VALUES (75,3,3,0,'Slave Labor Camp','You\'ve stumbled upon a slave labor camp. Make sure you aren\'t staring to obviously, or you may be forced into slavery yourself.');
INSERT INTO cityamenities VALUES (76,3,5,7,'Military Training Facility','This area is used to train military troops for field combat.');
INSERT INTO cityamenities VALUES (77,3,5,7,'Military Weapons Manufacturing Facility','Guns and armor are manufactured for military use here. Be warned, this facility is well guarded.');
INSERT INTO cityamenities VALUES (78,3,5,7,'Military Uniform Manufacturing Center','Military uniforms and other textiles are manufactured at this facility.');
INSERT INTO cityamenities VALUES (79,0,10,20,'Boarding House','Though slightly less expensive than an Inn, boarding houses require you to pay for a week or a month up front.');
INSERT INTO cityamenities VALUES (80,7,7,7,'Water Well','A well with fresh ground water, great for drinking water. This type of well is usually relatively free of radioactive particles. Careful, the owner of these wells usually charges a pretty steep rate, but if the water is good, it\'s worth it.');
INSERT INTO cityamenities VALUES (81,2,2,2,'Oil Well','After taking a few samples, you might find out that there is an oil well under this area.');
INSERT INTO cityamenities VALUES (82,5,5,5,'Valley','This berg is located in a valley, which offers excellent protection from harsh weather. It hides the village away from sight to avoid attacks from bandits.');
INSERT INTO cityamenities VALUES (83,1,1,10,'Brothel','If your vice is sex, then you\'ve come to the right place. It doesn\'t matter what your fetish is, or your sexual preference, this place is sure to please.');
INSERT INTO cityamenities VALUES (84,10,10,10,'Traveling Vendor','You may find a traveling vendor anytime, anywhere. They deal in basically everything, however they won\'t have a very large stock of anything. If they have ammunition, it will only be a few rounds. If they have rations, there will only be a couple.');
INSERT INTO cityamenities VALUES (85,10,10,10,'Junk Yard','Though it\'s fairly common to find a junk yard, it usually takes some effort to find anything of use in one, because people have been sifting through them for years.');
INSERT INTO cityamenities VALUES (86,10,10,10,'Rubble','The wasted remains of a forgotten building.');
INSERT INTO cityamenities VALUES (87,2,2,2,'Forrest','This settlement is surrounded by a forrest which provides good protection from the elements and a stable supply of building materials.');
INSERT INTO cityamenities VALUES (88,1,1,1,'Train Station','There is a nearby train station that is in good repair, which probably means that it\'s in use. Beware, that\'s usually a good indication of a military presence.');
INSERT INTO cityamenities VALUES (89,3,2,0,'Secret Cache','You overhear some locals whispering about a cache of  the village has compiled... if you look hard enough, and dont ask the wrong questions, you might be able to find out where it is...');
INSERT INTO cityamenities VALUES (90,1,1,10,'Stables','Sometimes a settlement will have stables with horses, cows, moxen, donkeys, or some other pack animal for rent. You\'re in luck, this settlement does.');
INSERT INTO cityamenities VALUES (91,10,25,50,'Tavern with Casino','This settlement has a tavern that has a casino within for entertainment. Though taverns are quite common, it is slightly more rare to find a tavern with this kind of entertainment.');
INSERT INTO cityamenities VALUES (92,10,25,50,'Tavern with a Stage','This tavern has a stage where all sorts of entertainers may perform. You may see jugglers, dancing girls, comedians, story tellers, plays, or even a concert.');
INSERT INTO cityamenities VALUES (93,10,25,50,'Tavern with a Brothel','This tavern has an in-house brothel. Therefore, when you have had your fill of liquor, you can go get your fill of a more pleasurable vice.');
INSERT INTO cityamenities VALUES (94,5,10,15,'Tavern with a Gameroom','Ah, a very rare find indeed. This tavern has a gameroom. Here you might find things like board games, cards, pool tables, darts, foosball, and perhaps even a role-playing game or two.');
